public class Solution {
    public boolean repeatedSubstringPattern(String str) {
        int len = str.length();
        for(int i = (len-1)/2; i>=0;i--){
        	String s_origin = str.substring(0, i+1);
        	String s_tail = str.substring(i+1,len);
        	int s_origin_len = s_origin.length();
        	int s_tail_len = s_tail.length();
        	if(s_tail_len%s_origin_len!=0){
        		continue;
        	}
        	while(s_tail.startsWith(s_origin)){
        		if(s_tail.equals(s_origin)){
        			return true;
        		}
        		s_tail_len = s_tail.length();
        		s_tail = s_tail.substring(s_origin_len, s_tail_len);
        	}
        }
    	return false;
    }
    
    public static void main(String[] args) {
		String s = "";
		System.out.println(new Solution().repeatedSubstringPattern(s));
	}
}